import React from 'react';

function RenderCard() {
  for (let i = 0; i < 3; i++) {
      return <div className="card-block"></div>;
  };
}

function App() {
  return (
    <div>
      <div className="header">
        <h1>Карточки</h1>
      </div>

      <div className="cards">
        <div className="card-block"></div>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <br/>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <br/>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <div className="card-block"></div>
        <br/>
        <RenderCard />
      </div>
    </div>
  );
}

export default App;
